    return (
      <div >


 <h1><a href={this.props.link}>{this.props.title}</a></h1>
 <h2>{this.props.author}</h2>
 <div id = "description">

 <img src ={this.props.image} alt="book_image"/><p>{this.props.description}</p>
 <button bookID={this.props.bookNum} onClick ={this.props.clickHandler} type="button"className="btn btn-dark">Remove From Course Adoptions</button>

 </div>
<div>
 </div>
      </div>
    );
  }
}

